import React, { Component } from 'react';
import SeccionForm from './SeccionForm';
import SeccionRadio from './SeccionRadio';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';

class FormOptimizacion extends React.Component{
    render(){
        return(
            <form>
                <SeccionForm titulo = "Sabores a producir" nombreTipo= "Sabor" nombreCantidad = "Demanda"/>
                <SeccionForm titulo = "Materias primas disponibles" nombreTipo= "Materia prima" nombreCantidad = "Disponibilidad"/>
                <SeccionRadio nombre = 'chota'/>
                <button type="submit" class="btn btn-dark"><i class="fas fa-calculator"></i> Calcular</button>
            </form>
        );
    }
}

export default FormOptimizacion;
